  get graphs(){
    if(this.props.station.length === 0){
      return(
    <div >
      <p>Additional information</p>
    </div>
    )
    }else {
      return(
    <div className='station-wraper'>
      {this.props.station.map(sta => {
        return (
          <div key={sta.id} className='station-card'>
          <h1>{sta.name}</h1>
          <Stands station={sta}/>
          </div>
        )
      })}
    </div>
    )
    }
  }

  render(){

  return this.graphs
}
}
